CREATE TABLE Customer(
   CustomerID   INTEGER  NOT NULL PRIMARY KEY 
  ,CustomerName VARCHAR(13)
  ,Address      VARCHAR(12)
  ,Login        VARCHAR(9)
  ,Password     VARCHAR(9)
  ,Gender       VARCHAR(6)
  ,Email        VARCHAR(23)
  ,Nationality  VARCHAR(13)
  ,IsSuperuser  BOOLEAN  
  ,IsAdmin      BOOLEAN 
);

